import React, { Component } from "react";
import './status.css';

class Status extends Component {
    constructor(props) {
        super(props);
        this.state = {
            header: {
                status: null,
                icon: "red fa fa-check-circle"
            }
        }
    }
    render() {
        return(
            <div className="status-container">
                <div className="status-cards-container">
                <div className="status-card">
                        <a className="status-card-left"><i className={this.state.header.icon}> </i> {this.state.header.status || "Internal Outage"}</a>
                        <a className="status-card-right"></a>
                    </div>

                    <div className="status-card">
                        <a className="status-card-left">Platinum: API</a>
                        <a className="status-card-right">OPERATIONAL</a>
                    </div>
                    <div className="status-card">
                        <a className="status-card-left">Hydrogen: Web App</a>
                        <a className="status-card-right">OPERATIONAL</a>
                    </div>
                    <div className="status-card">
                        <a className="status-card-left">Titanium: Desktop</a>
                        <a className="status-card-right">PATCHING</a>
                    </div>
                </div>
            </div>
        )
    }
}

export default Status;
